import React,{Component} from 'react';

class  Que extends Component
{
    constructor(props)
    {
        super(props);
    }
    render(){
        var x=this.props.difficulty;
        return (<div>
            <h1>{x}</h1>
        </div>);
    }
 
}

export default Que;
